import styled from "styled-components";

const Button = styled.button`
  cursor: pointer;
`
const Form = styled.form`
    display: flex;

    gap: 14px;
`

const Input = styled.input`
  width: 300px;
  height: 45px;
  border: none;
  border-radius: 6px;
  padding: 5px;
  background-color: #fff;

  ::placeholder{
      font-size: 14px;
      line-height: 40px;
      color: #000;
  }
`

export 
  { 
    Button,
    Form,
    Input
  }
